import React, { Component } from 'react';
import './Home.css';

class Home extends Component {
  render() {
    return (
        <div className="Container">
            <video autoplay="autoplay" loop="loop" muted className="Video">
                <source src={require('stars.mp4')} type="video/mp4"/>
            </video>

        </div>
    );
  }
}

export default Home;
